  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'home',
	slug: '/sdk/node/',
	title: 'Quick Start Guide'
};
export const metadata = {
  "unversionedId": "sdk/node/home",
  "id": "sdk/node/home",
  "isDocsHomePage": false,
  "title": "Quick Start Guide",
  "description": "Installation {installation}",
  "source": "@site/docs/sdk/node/home.mdx",
  "slug": "/sdk/node/",
  "permalink": "/sdk/node/",
  "editUrl": "https://github.com/dclist/docs/edit/master/docs/docs/sdk/node/home.mdx",
  "version": "current",
  "sidebar": "mainSidebar",
