  /* @jsxRuntime classic */
/* @jsx mdx */
import Tabs from '@theme/Tabs';
import TabItem from '@theme/TabItem';
export const toc = [{
  value: 'Installation',
  id: 'installation',
  children: []
}, {
  value: 'Start Coding',
  id: 'start-coding',
  children: [{
    value: 'Creating Client',
    id: 'creating-client',
    children: []
  }, {
    value: 'Interacting with API',
    id: 'interacting-with-api',
    children: []
  }, {
    value: 'Subscribing to Events',
    id: 'subscribing-to-events',
    children: []
  }]
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <h2 {...{
      "id": "installation"
    }}>{`Installation`}</h2>
    <p>{`You can easily install and start using dclist.net nodejs sdk. Sdk is available on `}<a parentName="p" {...{
        "href": "https://www.npmjs.com/"
      }}>{`npm`}</a>{` and `}<a parentName="p" {...{
        "href": "https://classic.yarnpkg.com"
      }}>{`yarn`}</a>{`.`}</p>
    <p>{`You copy-paste following commands to install :`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`npm i --save @dclist/sdk
`}</code></pre>
    <p>{`OR`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`yarn add @dclist/sdk
`}</code></pre>
    <h2 {...{
      "id": "start-coding"
    }}>{`Start Coding`}</h2>
    <p><strong parentName="p">{`We support typescript natively. You don't need to install any other packages.`}</strong></p>
    <p>{`If you want to learn more about sdk. You can take a look at our `}<a parentName="p" {...{
        "href": "sdk/node/advanced"
      }}>{`Advanced Guides`}</a></p>
    <h3 {...{
      "id": "creating-client"
    }}>{`Creating Client`}</h3>
    <p>{`Gateway client is the ultimate client for using dclist's api. You can do tons of things with it. We are going to learn more about it later.`}</p>
    <p>{`Simply you can create GatewayClient using your bot's dclist token.`}</p>
    <div {...{
      "className": "admonition admonition-info alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`DCList Token`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`You can obtain or regenerate your bot's dclist token in your bot's settings page under "`}<strong parentName="p">{`Api Settings`}</strong>{`".`}</p></div></div>
    <Tabs groupId="programming-language" defaultValue="ts" values={[{
      label: 'Typescript',
      value: 'ts'
    }, {
      label: 'JavaScript',
      value: 'js'
    }]} mdxType="Tabs">
      <TabItem value="ts" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-ts"
          }}>{`import { GatewayClient } from '@dclist/sdk'

const dclClient = new GatewayClient({
token: 'YOUR_DCLIST_TOKEN_HERE'
})
`}</code></pre>
      </TabItem>
      <TabItem value="js" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`const { GatewayClient } = require('@dclist/sdk')

const dclClient = new GatewayClient({
token: 'YOUR_DCLIST_TOKEN_HERE'
})
`}</code></pre>
      </TabItem>
    </Tabs>
    <h3 {...{
      "id": "interacting-with-api"
    }}>{`Interacting with API`}</h3>
    <p>{`You can easily interact with our graphql api using GatewayClient. Here is a simple example :`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-ts"
      }}>{`// To get bot by discord id
dclClient.getBotById('690214077490004030')

// To get user by discord id
dclClient.getUserById('690214077490004030')

// To check is user voted recently
dclClient.isUserVoted('690214077490004030')
`}</code></pre>
    <h3 {...{
      "id": "subscribing-to-events"
    }}>{`Subscribing to Events`}</h3>
    <p>{`You can also subscribe to events like new votes via GatewayClient. You don't have to set up a server to just receive new votes. It would be a waste of resource. Insted of you can simply call #subscribeTo function to listen for new event. Smart, isn't it.`}</p>
    <Tabs groupId="programming-language" defaultValue="ts" values={[{
      label: 'Typescript',
      value: 'ts'
    }, {
      label: 'JavaScript',
      value: 'js'
    }]} mdxType="Tabs">
      <TabItem value="ts" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-ts"
          }}>{`import { SubscriptionsTopicsEnum } from '@dclist/sdk'

dclClient.subscribeTo([SubscriptionsTopicsEnum.NEW_VOTE])

dclClient.on(SubscriptionsTopicsEnum.NEW_VOTE, (voteObj) => {
/* Do something with voteObj */
/* For example, send message to log channel  */
})
`}</code></pre>
      </TabItem>
      <TabItem value="js" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`dclClient.subscribeTo(['SDK_NEW_VOTE'])

dclClient.on('SDK_NEW_VOTE', (voteObj) => {
/* Do something with voteObj */
/* For example, send message to log channel  */
})
`}</code></pre>
      </TabItem>
    </Tabs>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
